export class User {
  username: string;
  password: string;
  role: string;
  email: string;
  civilStatus: string;
  gender: string;
  info: string;
  conditions: boolean;

  constructor(
    username: string,
    password: string,
    role: string,
    email: string,
    civilStatus: string,
    gender: string,
    info: string,
    conditions: boolean
  ) {
    this.username = username;
    this.password = password;
    this.role = role;
    this.email = email;
    this.civilStatus = civilStatus;
    this.gender = gender;
    this.info = info;
    this.conditions = conditions;
  }



}
